import React from "react";
import "./Cards.css";
import CardItem from "./CardItem";
import Wax from "../wax.jpg";
import Massage from "../massage.jpg";
import Nails from "../nails.jpg";

function Cards() {
  return (
    <div className="cards">
      <h1>Check out our amazing Services</h1>
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items">
            <CardItem
              src={Massage}
              text="Brazilian"
              label="Waxing"
              path="/services"
            />
            <CardItem
              src={Massage}
              text="Legs"
              label="Waxing"
              path="/services"
            />
          </ul>
          <ul className="cards__items">
            <CardItem
              src={Massage}
              text="Girl"
              label="Adventure"
              path="/products"
            />
            <CardItem
              src={Massage}
              text="Eyebrows"
              label="Adrenaline"
              path="/sign-up"
            />
            <CardItem
              src={Massage}
              text="Eyebrows"
              label="Adrenaline"
              path="/sign-up"
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
